import "./write.css";

export default function Write() {
  return (
    <div className="write">
      <form action="" className="writeForm">
        <div class="writeFormGroup">
          <label for="fileInput"></label>
          <input type="file" id="fileInput" />
          <input type="text" placeholder="Title" />
        </div>
      </form>
    </div>
  );
}
